const VerticalContainer = styled.div`
    display: flex;
    flex-direction: column;
    gap: 20px;
`;

export default function LeftNotice() {
    return (
        <VerticalContainer>
            <Notice />
            <UpcomigReleases />
            <Review />
        </VerticalContainer>
    );
}
